                <tr>
                  <img src={image} alt="" />
                </tr>
              </table>
            </div>

            <div className="img">
              <center>
                {" "}
                <h1 className="fa">Mention Your Complain Here!</h1>
                <table>
                  <tr>
                    <td  >Enter OrderId</td>
                    <td className="td"></td>
                    <td>
                      <input
                        type="number"
                        name="name"
                        placeholder="OrderId"
                        required
                        disabled
                        // onChange={(e) => {
                        //   setOrderWeight(e.target.value);
                        // }}
                      />
                    </td>
                  </tr>
                  <tr ></tr>
                  <tr className="tr"></tr>
                  <tr>
                    <td  >Select Issues </td>
                    <td className="td"></td>
                    <td>
                      <select
                        // onChange={(e) => {
                        //   setFromAddress(e.target.value);
                        // }}
                      >
                        <option> Select Issue</option>
                        <option>productDamage</option>
                        <option>deliveredLate</option>

                      </select>
                    </td>
                  </tr>
                  <tr className="tr"></tr>
                  <tr>
                  <td  >Enter Description</td>
                    <td className="td"></td>
                    <td>

                        <textarea>

                        </textarea>
                      {/* <input
                        type="text-area"
                        name="name"
                        placeholder="Description"

                        // onChange={(e) => {
                        //   setOrderWeight(e.target.value);
                        // }}
                      /> */}
                    </td>
                  </tr>
                  <tr className="tr"></tr>



                  <tr>
                    <td>
                        <center>
                        <button class="btn btn-success" 

                        >Submit</button>
                      </center>
                    </td>
                  </tr>
                </table>
              </center>
            </div>

            <div className="imag">



              <table>
                <tr className="tr"></tr>
                <tr className="image">
                  <img src={image1} alt="" />
                </tr>
                <tr className="tr"></tr>
                <tr className="image">
                  <img src={image2} alt="" />
                </tr>
              </table>
            </div>
          </div>
        </div>
      </div>
    </>
  );

}

export default Complain;
